import {StyleSheet} from 'react-native';

const styles = StyleSheet.create({
	container: {
		flex: 1,
		backgroundColor: '#888',
		alignItems: 'center',
	},
	singleModel: {
		flex: 1,
		backgroundColor: '#D4BF89',
		alignItems: 'center',
	},
	modelText: {
		flex: 1,
		alignItems: 'center',
	},
	modelName: {
		marginTop: 50,
		fontSize: 40,
	},
	singleModelUnit: {
	},

});

export default styles
